import React from "react";

function App() {
  const productCart = "Product Cart";
  return <h1>{productCart}</h1>;
  <ul>
    <li>Milk - 19.99</li>
    <li>Bread - 23.99</li>
    <li>Cheese - 40.99</li>
  </ul>;
}

export default App;
